export default (state, action) => {
  switch (action.type) {
    case "CHANGE_PAGE":
      console.log(action.payload)
      return {
        ...state,
        page: action.payload
      }

    case "LOGIN_USER":
      return {
        ...state,
        user: action.payload
      }

    case "ADD_USER":
      return {
        ...state,
        page: "login",
        message: action.payload
      }

    default:
      return state;
  }
};
